'select case t.SOURCE',
'         when 1 then',
'          ''AD''',
'         else',
'          ''UM''',
'       end || '': '' || t.NAME as d',
'      ,t.ID_OR_DN as r',
'  from ROLE_POOL t',
'-- Showable ROLE not equal to selected ROLE',
' where t.ID_OR_DN != nvl(:P320_ROLE_ID',
'                        ,''$NV$'')',
'      -- Not selected ROLE already a parent of showable ROLE, in order to avoid circular reference',
